import React, { Component } from 'react';
import {View,Alert,TouchableOpacity , ImageBackground, Text, Image, Button, StyleSheet, TextInput} from 'react-native';
// import bgimage from '../images/bg.jpg';
import Headerin from '../components/Header';
import imgg from '../images/G.png';
import fb from '../images/fb.webp';

    
class Loginlagi extends Component {
    _onPressButton() {

        Alert.alert('You tapped the button!')
    
      }
    
    render() { 
        
        return ( 
            <View style={{flex:1, alignItems:'center', justifyContent:'center', paddingBottom:100, backgroundColor:"#FFFFFF"}}>
                <Headerin/>
                <Text style={{textAlign: 'center', justifyContent: 'center', fontFamily:'Raleway-Bold'}}>LOGIN</Text>
                <TextInput
                    placeholder={'Username'}
                    style={styles.textInputContainerStart}
                />
                <TextInput
                    placeholder={'Password'} secureTextEntry={true}
                    style={styles.textInputContainer}
                />
                <View style={styles.buttonContainer}>
                    <Button onPress={this._onPressButton}
                    color={'green'} title='Submit'  />
                </View>
                <Text style={{textAlign: 'center', justifyContent: 'center'}}>OR</Text>
                <View style={styles.buttonContainerAlt}>
                    <TouchableOpacity>
                        <Image source={imgg} style={{width:40, height:40}}/>
                    </TouchableOpacity>
                    <Text>                        </Text>
                    <TouchableOpacity>
                        <Image source={fb} style={{width:40, height:40}}/>
                    </TouchableOpacity>
                </View>
                <Text>{"\n \n Skip"}</Text>
            </View>
            
            
         );
    }
}

const styles = StyleSheet.create({
    textInputContainerStart:{
        borderColor: 'gray',
         borderWidth: 1,
         borderRadius:10,
        alignItems: 'center',
         justifyContent:'center',
         textAlign:'center',
        width: 200,
         height: 35,
          padding:10,
           margin:20
    },
    textInputContainer:{
        borderColor: 'gray',
         borderWidth: 1,
         borderRadius:10,
         textAlign:'center',
        alignItems: 'center',
         justifyContent:'center',
        width: 200,
         height: 35
    },
    buttonContainer:{
        padding:20,
        marginTop:20
    },
    buttonContainerAlt: {
        margin: 10,
        flexDirection: 'row',
        justifyContent: 'space-between'
      }
})

 
export default Loginlagi;
